  return (
    <div>
      <CategoryList/>
      <BannerProduct/>


      <HorizentalCardProduct category={"airpodes"} heading={"Top's Airpodes"}/>
      <HorizentalCardProduct category={"airpodes"} heading={"Top's Airpodes"}/>
